pragma solidity ^0.4.23;

contract MultiAddress{
    address private owner;
    uint public numAddress;
    address[] private gotAddresses;
    struct User {
        string name;
        uint age;
    }
    mapping(address=>User) private userInfo;

    constructor() public {
        owner = msg.sender;
    }

    function hasEle(address[] list , address ele) pure private returns(bool){
        for (uint index = 0; index < list.length; index++) {
            if (list[index] == ele) {
                return false;
            }
        }
        return true;
    }

    function addListAddresses(address[] listAddresses) public returns (uint){
        for (uint index = 0; index < listAddresses.length; index++) {
            if (hasEle(gotAddresses,listAddresses[index])) {
                gotAddresses.push(listAddresses[index]);
                numAddress = numAddress + 1;
            } 
        }
        return numAddress;
    }
    function getListAddresses() view public returns (address[]){
        return gotAddresses;
    }


    function getAddressesNum(address[] list) pure public returns (uint){
        uint numList = 0;
        for (uint index = 0; index < list.length; index++) {
            numList += 1;
        }
        return numList;
    }

    function setUser(address add , string name , uint age) public returns(bool){
        userInfo[add] = User({name:name,age:age});
        return true;   
    }

    function getUserName(address add) view public returns (string) {
        return userInfo[add].name;
    }
    function getUserAge(address add) view public returns (uint) {
        return userInfo[add].age;
    }
}
